	const inputChanged = (event) => {
		setTodo({ ...todo, [event.target.name]: event.target.value });
	};

	const addTodo = () => {
		setTodos([...todos, todo]);
		setTodo({ description: "", date: "" });
	};

	return (
		<div>
			<h1>Hello</h1>
		</div>
	);
}
